/* NFSv4yy_try_NUL_trans - try to make a transition on the NUL character
 *
 * synopsis
 *	next_state = NFSv4yy_try_NUL_trans( current_state );
 */
    static NFSv4yy_state_type NFSv4yy_try_NUL_trans  (NFSv4yy_state_type NFSv4yy_current_state )
{
	register int NFSv4yy_is_jam;
    
	register YY_CHAR NFSv4yy_c = 1;
	while ( NFSv4yy_chk[NFSv4yy_base[NFSv4yy_current_state] + NFSv4yy_c] != NFSv4yy_current_state )
		{
		NFSv4yy_current_state = (int) NFSv4yy_def[NFSv4yy_current_state];
		if ( NFSv4yy_current_state >= 57 )
			NFSv4yy_c = NFSv4yy_meta[(unsigned int) NFSv4yy_c];
		}
	NFSv4yy_current_state = NFSv4yy_nxt[NFSv4yy_base[NFSv4yy_current_state] + (unsigned int) NFSv4yy_c];
	NFSv4yy_is_jam = (NFSv4yy_current_state == 56);
	if ( ! NFSv4yy_is_jam )
		*(NFSv4yy_state_ptr)++ = NFSv4yy_current_state;

	return NFSv4yy_is_jam ? 0 : NFSv4yy_current_state;
}

    static void NFSv4yyunput (int c, register char * NFSv4yy_bp )
{
	register char *NFSv4yy_cp;
    
    NFSv4yy_cp = (NFSv4yy_c_buf_p);

	/* undo effects of setting up NFSv4yytext */
	*NFSv4yy_cp = (NFSv4yy_hold_char);

	if ( NFSv4yy_cp < YY_CURRENT_BUFFER_LVALUE->NFSv4yy_ch_buf + 2 )
		{ /* need to shift things up to make room */
		/* +2 for EOB chars. */
		register int number_to_move = (NFSv4yy_n_chars) + 2;
		register char *dest = &YY_CURRENT_BUFFER_LVALUE->NFSv4yy_ch_buf[
					YY_CURRENT_BUFFER_LVALUE->NFSv4yy_buf_size + 2];
		register char *source =
				&YY_CURRENT_BUFFER_LVALUE->NFSv4yy_ch_buf[number_to_move];

		while ( source > YY_CURRENT_BUFFER_LVALUE->NFSv4yy_ch_buf )
			*--dest = *--source;

		NFSv4yy_cp += (int) (dest - source);
		NFSv4yy_bp += (int) (dest - source);
		YY_CURRENT_BUFFER_LVALUE->NFSv4yy_n_chars =
			(NFSv4yy_n_chars) = YY_CURRENT_BUFFER_LVALUE->NFSv4yy_buf_size;

		if ( NFSv4yy_cp < YY_CURRENT_BUFFER_LVALUE->NFSv4yy_ch_buf + 2 )
			YY_FATAL_ERROR( "flex scanner push-back overflow" );
		}

	*--NFSv4yy_cp = (char) c;

    if ( c == '\n' ){
        --NFSv4yylineno;
    }

	(NFSv4yytext_ptr) = NFSv4yy_bp;
	(NFSv4yy_hold_char) = *NFSv4yy_cp;
	(NFSv4yy_c_buf_p) = NFSv4yy_cp;
}

