/** Switch to a different input buffer.
 * @param new_buffer The new input buffer.
 * 
 */
    void NFSv4yy_switch_to_buffer  (YY_BUFFER_STATE  new_buffer )
{
    
	/* TODO. We should be able to replace this entire function body
	 * with
	 *		NFSv4yypop_buffer_state();
	 *		NFSv4yypush_buffer_state(new_buffer);
     */
	NFSv4yyensure_buffer_stack ();
	if ( YY_CURRENT_BUFFER == new_buffer )
		return;

	if ( YY_CURRENT_BUFFER )
		{
		/* Flush out information for old buffer. */
		*(NFSv4yy_c_buf_p) = (NFSv4yy_hold_char);
		YY_CURRENT_BUFFER_LVALUE->NFSv4yy_buf_pos = (NFSv4yy_c_buf_p);
		YY_CURRENT_BUFFER_LVALUE->NFSv4yy_n_chars = (NFSv4yy_n_chars);
		}

	YY_CURRENT_BUFFER_LVALUE = new_buffer;
	NFSv4yy_load_buffer_state( );

	/* We don't actually know whether we did this switch during
	 * EOF (NFSv4yywrap()) processing, but the only time this flag
	 * is looked at is after NFSv4yywrap() is called, so it's safe
	 * to go ahead and always set it.
	 */
	(NFSv4yy_did_buffer_switch_on_eof) = 1;
}

static void NFSv4yy_load_buffer_state  (void)
{
    	(NFSv4yy_n_chars) = YY_CURRENT_BUFFER_LVALUE->NFSv4yy_n_chars;
	(NFSv4yytext_ptr) = (NFSv4yy_c_buf_p) = YY_CURRENT_BUFFER_LVALUE->NFSv4yy_buf_pos;
	NFSv4yyin = YY_CURRENT_BUFFER_LVALUE->NFSv4yy_input_file;
	(NFSv4yy_hold_char) = *(NFSv4yy_c_buf_p);
}

/** Allocate and initialize an input buffer state.
 * @param file A readable stream.
 * @param size The character buffer size in bytes. When in doubt, use @c YY_BUF_SIZE.
 * 
 * @return the allocated buffer state.
 */
    YY_BUFFER_STATE NFSv4yy_create_buffer  (FILE * file, int  size )
{
	YY_BUFFER_STATE b;
    
	b = (YY_BUFFER_STATE) NFSv4yyalloc(sizeof( struct NFSv4yy_buffer_state )  );
	if ( ! b )
		YY_FATAL_ERROR( "out of dynamic memory in NFSv4yy_create_buffer()" );

	b->NFSv4yy_buf_size = size;

	/* NFSv4yy_ch_buf has to be 2 characters longer than the size given because
	 * we need to put in 2 end-of-buffer characters.
	 */
	b->NFSv4yy_ch_buf = (char *) NFSv4yyalloc(b->NFSv4yy_buf_size + 2  );
	if ( ! b->NFSv4yy_ch_buf )
		YY_FATAL_ERROR( "out of dynamic memory in NFSv4yy_create_buffer()" );

	b->NFSv4yy_is_our_buffer = 1;

	NFSv4yy_init_buffer(b,file );

	return b;
}

/** Destroy the buffer.
 * @param b a buffer created with NFSv4yy_create_buffer()
 * 
 */
    void NFSv4yy_delete_buffer (YY_BUFFER_STATE  b )
{
    
	if ( ! b )
		return;

	if ( b == YY_CURRENT_BUFFER ) /* Not sure if we should pop here. */
		YY_CURRENT_BUFFER_LVALUE = (YY_BUFFER_STATE) 0;

	if ( b->NFSv4yy_is_our_buffer )
		NFSv4yyfree((void *) b->NFSv4yy_ch_buf  );

	NFSv4yyfree((void *) b  );
}

