/* NFSv4yylex_destroy is for both reentrant and non-reentrant scanners. */
int NFSv4yylex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		NFSv4yy_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		NFSv4yypop_buffer_state();
	}

	/* Destroy the stack itself. */
	NFSv4yyfree((NFSv4yy_buffer_stack) );
	(NFSv4yy_buffer_stack) = NULL;

    NFSv4yyfree ( (NFSv4yy_state_buf) );
    (NFSv4yy_state_buf)  = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * NFSv4yylex() is called, initialization will occur. */
    NFSv4yy_init_globals( );

    return 0;
}

